           l[0]*l[1]/(36*l[2]) - l[0]*l[2]/(18*l[1]) - l[2]*np.tan(g[0])/6 - l[1]*l[2]*np.tan(g[0])**2/(18*l[0]) - l[1]*l[2]*np.tan(g[1])**2/(18*l[0]) - l[1]*l[2]/(18*l[0]),
