           l[0]*l[1]/(9*l[2]) + l[0]*l[2]/(9*l[1]) - l[1]*np.tan(g[1])/6 + l[2]*np.tan(g[0])/6 + l[1]*l[2]*np.tan(g[0])**2/(9*l[0]) + l[1]*l[2]*np.tan(g[1])**2/(9*l[0]) + l[1]*l[2]/(9*l[0]),
